import React  from "react";
import '../components/styles/leftnav.scss'



const Leftnav = ({arraySong, setIsPlaying, setCurrentSong}) =>{
    function changeSong(){
        setCurrentSong(arraySong)
        setIsPlaying(arraySong)
    }
    return(
        <div className='library' onClick={changeSong}>
            <h1>Library</h1>
            <div className='library-flex'>
                <div className='library-colone'>
                    <img src={arraySong.cover} alt=""/>
                    <h3>{arraySong.name}</h3>
                    <p>{arraySong.artist}</p>
                </div>
            </div>
        </div>
    )
}





export default Leftnav
